import React from 'react';
import './App.css';
import axios from 'axios'

const api = axios.create({
  baseURL: 'http://localhost:9200/company_test/_search?q=company_name:Docuprint'
})
let jsonVar
api.get('')
  .then((res) => {
    console.log(res.data.hits.hits[0]._source);
    jsonVar = res.data.hits.hits[0]._source
  });

class App extends React.Component {

  render() {
    return (
      <div>
        <h1>{jsonVar}</h1>
      </div>
    )

  }
}

export default App;
